import Link from 'next/link';

const Index = () => (
    <div>
        <nav>
            <Link to="/"><a>Home</a></Link>
            <Link to="/about"><a>About</a></Link>
        </nav>
        <h1>Next Introduction</h1>
    </div>
);

export default Index;
